                    strings3.Add(jo["data"][i]["colorName"].ToString());
                    strings4.Add(jo["data"][i]["colorName"].ToString());
                    strings5.Add(jo["data"][i]["colorName"].ToString());
                    strings6.Add(jo["data"][i]["colorName"].ToString());
                    strings7.Add(jo["data"][i]["colorName"].ToString());
                    strings8.Add(jo["data"][i]["colorName"].ToString());
                }
