        /// <summary>
        /// 组托失败，人工录入条码，重新执行组托
        /// </summary>
        /// <param name="number"></param>
        public void ShowDialogStore(int number) //111
        {
            //string url = "http://122.224.159.38:8990/api/AutoPack/ToPackage"; //执行向ERP申请组托
            string postdata = XmlUtility.XmlToJson(zutuoXml);
            GlobalLog.WriteInfoLog("执行向ERP申请组托：" + postdata);
            DateTime dateTime = DateTime.Now;   //执行组托前时间
            string resParameter = HttpServer.PostUrl(ToPackage, postdata);
            DateTime lastDateTime = DateTime.Now; //执行组托完成时间
            Action<string> action = new Action<string>(ShowToErpTime);
            this.BeginInvoke(action, (lastDateTime - dateTime).Milliseconds.ToString());

            GlobalLog.WriteInfoLog("执行组托接口使用时间：" + (lastDateTime - dateTime).Milliseconds.ToString());
            GlobalLog.WriteInfoLog("执行向ERP申请组托反馈：" + XmlUtility.ConvertJsonString(resParameter));
            if (resParameter != "")
            {
                if (resParameter.Substring(0, 2) == "-1")
                {
                    DialogResult dialogResult = MessageBox.Show(resParameter.Substring(2), "提示", MessageBoxButtons.OKCancel, MessageBoxIcon.Information);
                    if (dialogResult == DialogResult.OK)
                    {
                        //组托访问ERP系统错误写入PLC
                        plcUtility1.WriteSingle("DB200.DBW10", Convert.ToInt16(1));
                        Package package = new Package();
                        package.ShowDialog();
                        ShowDialogStore(number);
                    }
                    else
                    {
                        XmlUtility.UpdateXmlNode(ResProductStateXml, "ColStorehouseState", number, 2);
                        XmlUtility.UpdateXmlNode(ResProductStateXml, "Grating", (number + 1), 1);
                        Debug.WriteLine("组托失败：" + "库位：" + number + "--" + resParameter.Substring(2));
                        GlobalLog.WriteInfoLog("组托失败：" + "库位：" + number + "--" + resParameter.Substring(2));
                    }

                    return;
                }
                JObject jo = JObject.Parse(resParameter);
                string status = jo["status"].ToString();
                if (status == "0")
                {
                    string zuotuoCode = XmlUtility.Parse(resParameter);  //从ERP获取组托码
                    XmlUtility.WriteXmlNodeValue(materialQRXml, "state", number.ToString(), "GroupPalletInfo", zuotuoCode); //组托码写入materialQRXml
                    XmlUtility.UpdateXmlNode(ResProductStateXml, "ColStorehouseState", number, 1); //设置生产线状态中库位为：1-出库允许
                    XmlUtility.UpdateXmlNode(ResProductStateXml, "Grating", (number + 1), 1); //设置生产线状态中光栅为：1-光栅可进入
                    Debug.WriteLine("组托完成" + "库位：" + number);
                    GlobalLog.WriteInfoLog("组托完成" + "库位：" + number);
                }
                else
                {
                    string msg = jo["msg"].ToString();
                    DialogResult dialogResult = MessageBox.Show(msg, "提示", MessageBoxButtons.OKCancel, MessageBoxIcon.Information);
                    if (dialogResult == DialogResult.OK)
                    {
                        Package package = new Package();
                        package.ShowDialog();
                        ShowDialogStore(number);
                    }
                    else
                    {
                        XmlUtility.UpdateXmlNode(ResProductStateXml, "ColStorehouseState", number, 2);
                        XmlUtility.UpdateXmlNode(ResProductStateXml, "Grating", (number + 1), 1);
                        Debug.WriteLine("组托失败：" + "库位：" + number + "--" + msg);
                        GlobalLog.WriteInfoLog("组托失败：" + "库位：" + number + "--" + msg);
                    }
                }
            }
            else
            {
                DialogResult dialogResult = MessageBox.Show("执行组托接口返回参数为空！", "提示", MessageBoxButtons.OKCancel, MessageBoxIcon.Information);
                if (dialogResult == DialogResult.OK)
                {
                    Package package = new Package();
                    package.ShowDialog(); //人工录入组托码
                    ShowDialogStore(number);
                }
                else
                {
                    XmlUtility.UpdateXmlNode(ResProductStateXml, "ColStorehouseState", number, 2); //设置生产线状态中库位为：2-NG-出库允许
                    XmlUtility.UpdateXmlNode(ResProductStateXml, "Grating", (number + 1), 1);
                    Debug.WriteLine("组托失败：接口返回参数为空" + "库位：" + number);
                    GlobalLog.WriteInfoLog("组托失败：接口返回参数为空" + "库位：" + number);
                }
            }
        }

