        public void GetFeeding()
        {
            while (!ts.Token.IsCancellationRequested)
            {
                if (plcUtility.IsRunning)
                {
                    lock (OResProductState)
                    {
                        #region //获取上料平台状态
                        List<string> list = new List<string>();
                        for (int i = 0; i < 25; i += 4)
                        {
                            int value = Convert.ToInt32(plcUtility.ReadSingle("DB101.DBW" + i.ToString()));
                            if (value == 3)
                            {
                                list.Add("0");  //上料平台状态 3=0 空闲 允许上料
                            }
                            else
                            {
                                list.Add("1");
                            }
