                            grateOut.Add(value.ToString());
                            //XmlUtility.WriteXmlNodeValue1(ResProductStateXml, "state", count.ToString(), "Grating", value.ToString());
                        }
                        XmlUtility.WriteListToXml(ResProductStateXml, grateOut, "Grating");
                        #endregion
                    }
                    
                }
            }
        }
