        //连接打印
        public bool PrintLabel(string ip, Image image)
        {
            Zebra.Sdk.Graphics.ZebraImageI zebraImageI = Zebra.Sdk.Graphics.ZebraImageFactory.GetImage(image);
            Zebra.Sdk.Comm.Connection conn = new Zebra.Sdk.Comm.TcpConnection(ip, Zebra.Sdk.Comm.TcpConnection.DEFAULT_ZPL_TCP_PORT);
            try
            {
                conn.Open();
                ZebraPrinter zebraPrinter = ZebraPrinterFactory.GetInstance(conn);
                //zebraPrinter.PrintImage(zebraImageI, 0, 0, zebraImageI.Width, zebraImageI.Height, false);
                return ExecutePrint(zebraPrinter, zebraImageI);
            }
            catch (ConnectionException ce)
            {
                GlobalLog.WriteInfoLog(ce.ToString());
                return false;
            }
            catch (ZebraPrinterLanguageUnknownException zplue)
            {
                GlobalLog.WriteInfoLog(zplue.ToString());
                return false;
            }
            catch (IOException ioe)
            {
                GlobalLog.WriteInfoLog(ioe.ToString());
                return false;
            }
            finally
            {
                conn.Close();
            }
        }

        /// <summary>
        /// 执行打印任务
        /// </summary>
        /// <param name="zebraPrinter"></param>
        /// <param name="zebraImageI"></param>
        /// <returns></returns>
        public bool ExecutePrint(ZebraPrinter zebraPrinter, ZebraImageI zebraImageI)
        {
            PrinterStatus printerStatus = zebraPrinter.GetCurrentStatus();
            if (printerStatus.isPaperOut != true && printerStatus.isRibbonOut != true && printerStatus.isReadyToPrint == true)
            {
                zebraPrinter.PrintImage(zebraImageI, 0, 0, zebraImageI.Width, zebraImageI.Height, false);
                PrinterStatus printReady = zebraPrinter.GetCurrentStatus();
                if (printReady.isReadyToPrint == true)
                {
                    Thread.Sleep(10);
                    return true;
                }
                else
                {
                    return false;
                }
            }
            else
            {
                plcUtility1.WriteSingle("DB200.DBW4", Convert.ToInt16(10));
                DialogResult dialogResult = MessageBox.Show("打印机标签纸或色带用尽，请更换", "提示", MessageBoxButtons.OK, MessageBoxIcon.Information);
                if (dialogResult == DialogResult.OK)
                {
                    bool comp = ExecutePrint(zebraPrinter, zebraImageI);
                    return comp;
                }
                else
                {
                    return false;
                }
            }
        }

        /// <summary>
        /// 获取标签图片与颜色 --失败弹窗，PLC更正二维码，重新执行
        /// </summary>
        /// <param name="code"></param>
        public void ShowDialogInfo()
        {
            int count = plcUtility1.ReadSingleStringLength(DataType.DataBlock, 201, 4, VarType.Byte, 1); //code:二维码 从PLC获取 "20252FOW0J0.601120230218BC05008-60"
            code = plcUtility1.ReadSingleString(DataType.DataBlock, 201, 4, VarType.S7String, count);
            GlobalLog.WriteErrorLog("从PLC读取的打印二维码：" + code);
            //string url = "http://122.224.159.38:8990/api/AutoPack/GetLabelFileInfo" + "?code=" + code;
            string url = GetLabelFileInfo + "?code=" + code;
            string resParameter = HttpServer.GetUrl(url);
            if (resParameter != "")
            {
                if (resParameter.Substring(0, 2) == "-1")
                {
                    DialogResult dialogResult = MessageBox.Show(resParameter.Substring(2), "提示", MessageBoxButtons.OK, MessageBoxIcon.Information);
                    if (dialogResult == DialogResult.OK)
                    {
                        //获取标签图片信息错误写入PLC
                        plcUtility1.WriteSingle("DB200.DBW6", Convert.ToInt16(1));
                        ShowDialogInfo();
                    }
                }
                GlobalLog.WriteErrorLog("获取标签颜色和颜色：" + resParameter);
                object pairs = JsonConvert.DeserializeObject(resParameter);
                JObject jo = JObject.Parse(pairs.ToString());
                string status = jo["status"].ToString();
                if (status == "0")
                {
                    string colorId = jo["data"]["colorId"].ToString(); //colorId 为空判断
                    string colorName = jo["data"]["colorName"].ToString(); //colorId 为空判断
                    string printNo = XmlUtility.ReadNodeName(labelcolorIdXml, "labelcolorId", colorId);
                    if (printNo != "")
                    {
                        string img = jo["data"]["img"].ToString();
                        XmlUtility.WriteXmlNodeValue1(imageXml, "state", printNo.ToString(), "imageInfo", img); //base64写入xml //code:二维码  colorId
                        plcUtility1.WriteSingle("DB200.DBW2", Convert.ToInt16(printNo)); //向PLC发送打印机编号
                        plcUtility1.WriteSingle("DB200.DBW0", Convert.ToInt16(2));
                        GlobalLog.WriteErrorLog("打印机编号：" + printNo);
                    }
                    else
                    {
                        plcUtility1.WriteSingle("DB200.DBW0", Convert.ToInt16(10)); //打印失败
                        DialogResult dialogResult = MessageBox.Show("无对应颜色的标签纸：" + "颜色名称：" + colorName, "提示", MessageBoxButtons.OK, MessageBoxIcon.Information);
                        if (dialogResult == DialogResult.OK)
                        {
                            ShowDialogInfo();
                        }
                    }
                }
                else
                {
                    plcUtility1.WriteSingle("DB200.DBW0", Convert.ToInt16(10));
                    DialogResult dialogResult = MessageBox.Show(jo["msg"].ToString(), "提示", MessageBoxButtons.OK, MessageBoxIcon.Information);
                    if (dialogResult == DialogResult.OK)
                    {
                        ShowDialogInfo();
                    }
                }
            }
            else
            {
                plcUtility1.WriteSingle("DB200.DBW0", Convert.ToInt16(10));
                DialogResult dialogResult = MessageBox.Show("获取标签图片与颜色参数为空", "提示", MessageBoxButtons.OK, MessageBoxIcon.Information);
                if (dialogResult == DialogResult.OK)
                {
                    ShowDialogInfo();
                }
            }

        }
