        private void UpdatePrintState()
        {
            while (!ts.Token.IsCancellationRequested)
            {
                if (plcUtility1.IsRunning)
                {
                    for (int i = 0; i < 1; i++)
                    {
                        int value = Convert.ToInt32(plcUtility1.ReadSingle("DB201.DBW" + i.ToString()));
                        if (value == 0)
                        {
                            plcUtility1.WriteSingle("DB200.DBW0", Convert.ToInt16(1));

                        }
                        else if (value == 2)
                        {
                            plcUtility1.WriteSingle("DB200.DBW0", Convert.ToInt16(3));
                        }
                    }
                    for (int j = 260; j < 261; j++)
                    {
                        int value1 = Convert.ToInt32(plcUtility1.ReadSingle("DB201.DBW" + j.ToString()));
                        if (value1 == 0)
                        {
                            plcUtility1.WriteSingle("DB200.DBW4", Convert.ToInt16(1));
                        }
                        else if (value1 == 2)
                        {
                            plcUtility1.WriteSingle("DB200.DBW4", Convert.ToInt16(3));
                        }
                    }
                }
            }
        }

