                    XmlUtility.WriteXmlNodeValue(labelcolorIdXml, "state", (i + 1).ToString(), "labelcolorName", labelColors[i]);
                }

                //string url = "http://122.224.159.38:8990/api/AutoPack/GetLabelFileColor"; //获取颜色档案
                DateTime dateTime = DateTime.Now; //执行接口时间
                string resParameter = HttpServer.GetUrl(GetLabelFileColor);
                DateTime lastDateTime = DateTime.Now;
                GlobalLog.WriteInfoLog("执行获取颜色档案接口使用时间：" + (lastDateTime - dateTime).Milliseconds.ToString());
                GlobalLog.WriteInfoLog("手动执行-获取颜色档案：" + resParameter);
                if (resParameter != "")
                {
                    object pairs = JsonConvert.DeserializeObject(resParameter);
                    JObject jo = JObject.Parse(pairs.ToString());
                    string status = jo["status"].ToString();
                    if (status == "0")
                    {
                        List<string> labelColorId = new List<string>(); //colorId
                        List<string> colors = XmlUtility.ReadFirstChildToList(labelcolorIdXml, "labelcolorName");
                        for (int i = 0; i < colors.Count; i++)
                        {
                            for (int j = 0; j < jo["data"].Count(); j++)
                            {
                                string colorId = jo["data"][j]["colorId"].ToString();
                                labelColorId.Add(colorId);
                                if (colors[i] == jo["data"][j]["colorName"].ToString())
                                {
                                    XmlUtility.WriteXmlNodeName(labelcolorIdXml, "labelcolorId", "state", (i + 1).ToString(), "colorId", colorId);
                                }
                            }
                        }
                        MessageBox.Show("更新打印机标签纸颜色完成", "提示", MessageBoxButtons.OK, MessageBoxIcon.Information);
                    }
                    else
                    {
                        MessageBox.Show(jo["mag"].ToString(), "提示", MessageBoxButtons.OK, MessageBoxIcon.Information);
                    }
                }
                else
                {
                    MessageBox.Show("请求ERP更新标签颜色接口返回参数为空", "提示", MessageBoxButtons.OK, MessageBoxIcon.Information);
                }
            }
            else
            {
                MessageBox.Show("参数不能为空", "提示", MessageBoxButtons.OK, MessageBoxIcon.Information);
            }
        }

