        private void Main_FormClosing(object sender, FormClosingEventArgs e)
        {
            EmptyLoad();
            EmptyOutPut();
            if (plcUtility1 != null)
            {
                plcUtility1.WriteSingle("DB204.DBW0", Convert.ToInt16(0)); //上料PC状态
                plcUtility1.WriteSingle("DB204.DBW2", Convert.ToInt16(0)); //打印PC状态
                plcUtility1.WriteSingle("DB204.DBW4", Convert.ToInt16(0)); //WMS_PC正常
            } 
        }
        /// <summary>
        /// 软件异常中断时，清空上料平台数据
        /// </summary>
        public void EmptyLoad()
        {
            //复位上料平台-1
            for (int i = 1; i < 8; i++)
            {
                XmlUtility.UpdateXmlNode(ResProductStateXml, "Feeding", i, 1);
            }
        }
        /// <summary>
        /// 软件异常中断时，清空出库平台数据
        /// </summary>
        public void EmptyOutPut()
        {
            //复位出库平台-0
            for (int i = 1; i < 14; i++)
            {
                XmlUtility.UpdateXmlNode(ResProductStateXml, "ColStorehouseState", i, 0);
            }
        }

